import React from 'react'
import './Login.css'

function Login() {
    return (
        <div className='login'>
            {/* Spotify Logo */}
            <img src="https://getheavy.com/wp-content/upload"
            alt=""/>
            {/* Login with spotify */}
        </div>
    )
}

export default Login;
